  d_bab_raw &lt;- (add_osm_feature(q, key = "highway", value = "motorway") |&gt; osmdata_sf())$osm_lines
  d_bab &lt;- d_bab_raw |&gt;
    filter(st_contains(d_de, d_bab_raw, sparse = FALSE)[1,]) |&gt;
